  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a record of fish distribution
  and activity for REDBAND TROUT contained in the StreamNet database. This feature
  class was created based on linear event data extracted from the StreamNet database
  on March 21, 2006. Distribution is based upon the best professional judgement of
  local fish biologists, in the Pacific Northwest Region (Oregon, Washington, and
  Idaho). These data were collected by biologists at the state fish & wildlife agencies
  of Washington (WDFW), Oregon (ODFW) and Idaho (IDFG). Data were then compiled by
  StreamNet staff into paper maps or event tables at the state level. These event
  tables were submitted to the StreamNet regional staff at Pacific States Marine Fisheries
  Commision (PSMFC) where this regional distribution feature class was created from
  the source route event tables. All data is referenced to the PNW 1:100,000 River
  Reach Hydrography (http://www.streamnet.org/pnwr/pnwrhome.html) on the LLID-based
  stream routing system.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
